import RetuRnLogo from './Logo';
import ReturnButton from './Btn';
import ComptedAshAdmin from './Compte/Main';
import ExchAdmin from './Exchange/Main';

// Dash Component Admin
export default function ReturndAsh() {
 return (
  <div className='wrp-dash-admin'>
   <RetuRnLogo />
   <ReturnButton />

   <div>

    <ComptedAshAdmin />
    <ExchAdmin />
   </div>
  </div>
 )
};
